import { useState } from "react";
import useFetch from "./useFetch";



const Home = () => {

    const { error, isPending, data} = useFetch('http://127.0.0.1:5000/projects')

    const [age, setAge] = useState(1)

    const handleClick = () => {
        setAge(age + 1)
    }


    return ( 
        <div className="home">
        <h2>home page {age}</h2>
        <button onClick={handleClick}>Click me!</button>
        </div>
     );
}
 
export default Home;
